Doctor Solar, Man of the Atom Vol. 2 - Revelation/Solar Rise

English | CBR | 4 Issues

Genre: Science-Fiction, Action/Adventure

Written by Jim Shooter
Art by Roger Robinson, Agustin Alessio, Diego Bernard
Cover Art by Michael Komarck

An icon of heroic fiction, Doctor Solar, Man of the Atom returns to comics

Ruthless power broker Tanek Nuro has hacked into the operating system of the universe. With no limit to his monstrous ambition and only Doctor Solar in his way, a new Big Bang is about to begin! Plus, the mind-blowing origin of the Man of the Atom is revealed: how did a middle-aged physicist come to command the fires of creation? Everything you knew--and everything you didn't--is about to cross the event horizon!

